import Nasal from '../Images/nsal.jpg'
import Swab from '../Images/swab.jpg'
import IfPossitive from '../Images/ifPossitive.jpg'

const TestData = [{
    id: 1,
    imgSrc: Nasal,
    text: "How to Collect An Anterior Nasal Swab specimen for Covid-19 Test",
    link: "https://www.cdc.gov/coronavirus/2019-ncov/testing/self-testing.html?CDC_AA_refVal=https%3A%2F%2Fwww.cdc.gov%2Fcoronavirus%2F2019-ncov%2Ftesting%2Fat-home-testing.html"
}, {
    id: 2,
    imgSrc: Swab,
    text: "How to Collect a Nasal Mid-Turbinate Swab Sample for Covid-19 Test",
    link: "https://www.cdc.gov/coronavirus/2019-ncov/testing/self-testing.html?CDC_AA_refVal=https%3A%2F%2Fwww.cdc.gov%2Fcoronavirus%2F2019-ncov%2Ftesting%2Fat-home-testing.html"
}, {
    id: 3,
    imgSrc: IfPossitive,
    text: "What Your Test Result Mean",
    link: "#"
}]

export default TestData;
